const functions = require('firebase-functions');
const SibApiV3Sdk = require('sib-api-v3-sdk');
const admin = require('firebase-admin');
const nodemailer = require('nodemailer');

// Initialize Firebase Admin
if (!admin.apps.length) {
  admin.initializeApp();
}

const db = admin.firestore();

// Initialize Brevo API key from Firebase config
const defaultClient = SibApiV3Sdk.ApiClient.instance;
const apiKey = defaultClient.authentications['api-key'];

exports.sendTestEmail = functions.https.onRequest(async (req, res) => {
  try {
    // Set the API key for this request
    apiKey.apiKey = functions.config().brevo.key;
    
    const apiInstance = new SibApiV3Sdk.TransactionalEmailsApi();
    const sendSmtpEmail = {
      to: [{ email: req.body.to || 'your@email.com', name: req.body.name || 'Recipient' }],
      sender: { email: 'your@email.com', name: 'Your Name' },
      subject: req.body.subject || 'Test Email from Firebase + Brevo',
      htmlContent: req.body.html || '<h1>Hello from Firebase Functions + Brevo!</h1>'
    };
    await apiInstance.sendTransacEmail(sendSmtpEmail);
    res.status(200).send('Email sent successfully!');
  } catch (error) {
    console.error('Error sending email:', error);
    res.status(500).send('Failed to send email.');
  }
});

exports.notifyGeneralInquiry = functions.firestore.document('generalInquiries/{docId}').onCreate(async (snap, context) => {
  try {
    // Set the API key for this request
    apiKey.apiKey = functions.config().brevo.key;
    
    const data = snap.data();
    const apiInstance = new SibApiV3Sdk.TransactionalEmailsApi();
    const html = Object.entries(data).map(([key, value]) => `<b>${key}:</b> ${value}<br>`).join('');
    const sendSmtpEmail = {
      to: [{ email: 'info@realinvestco.com', name: 'Admin' }],
      sender: { email: 'info@realinvestco.com', name: 'Website Bot' },
      subject: 'New General Inquiry Received',
      htmlContent: `<h2>New General Inquiry</h2>${html}`
    };
    await apiInstance.sendTransacEmail(sendSmtpEmail);
    console.log('General inquiry email sent.');
  } catch (error) {
    console.error('Error sending general inquiry email:', error);
  }
});

